import { Calendar, MapPin } from 'lucide-react';

const meetupData = [
  {
    id: 'm1',
    title: 'Cozy Classics Swap',
    city: 'Portland, OR',
    date: 'Dec 7, 2025',
    attendees: 18,
  },
  {
    id: 'm2',
    title: 'Sci-Fi Sunday',
    city: 'Austin, TX',
    date: 'Dec 14, 2025',
    attendees: 24,
  },
  {
    id: 'm3',
    title: 'Mystery Brunch',
    city: 'Toronto, CA',
    date: 'Jan 4, 2026',
    attendees: 12,
  },
];

const Meetups = () => (
  <div className="rounded-3xl border border-slate-200 bg-white p-6 shadow-sm">
    <div className="flex items-center gap-3 text-xs uppercase tracking-[0.3em] text-slate-400">
      <Calendar className="h-4 w-4 text-slate-500" />
      Upcoming meetups
    </div>
    <ul className="mt-4 space-y-4">
      {meetupData.map((meetup) => (
        <li
          key={meetup.id}
          className="rounded-2xl border border-slate-100 bg-slate-50 px-4 py-3 text-sm text-slate-600"
        >
          <p className="text-base font-semibold text-slate-900">{meetup.title}</p>
          <div className="mt-1 flex items-center gap-3 text-xs text-slate-500">
            <span className="inline-flex items-center gap-1">
              <MapPin className="h-3.5 w-3.5" />
              {meetup.city}
            </span>
            <span>{meetup.date}</span>
            <span>{meetup.attendees} attending</span>
          </div>
          <button className="mt-3 rounded-full border border-slate-200 px-3 py-1 text-xs font-semibold text-slate-600 hover:border-slate-300">
            RSVP
          </button>
        </li>
      ))}
    </ul>
  </div>
);

export default Meetups;
